import "../CSS/Footer.css";
import React from "react";

function Footer() {
   return (
      <div className="h">
         <div className="col">
            <ul>
               <li>more info</li>
               <li>others</li>
               <li>contact us</li>
            </ul>
         </div>
         <div className="col">
            <ul>
               <li>email</li>
               <li>copyrights</li>
               <li>message us</li>
            </ul>
         </div>
      </div>
   );
}

export default Footer;
